 @fortheloveofit5317 The visualization I was asking about would show the probability distribution of electrons in 3D and dynamic would be nice. Keep in mind that not all bonds of a particular type look identical with respect to electron cloud density and you need to account for the types of orbitals in the bond.

Back to basics, take the delocalized electrons in benzene.  The textbook illustration seems to represent equal probability everywhere above and below the plane of the molecule and zero density in the plane. I'd like a more detailed representation similar to these animations. Then a natural question would be what happens when you add different functional groups. 

My general belief is that different models help build differnt intuitions, thus having a new representation would be beneficial.  I'd still love to see your models.  Can you share in a Google Doc?

