 @dimasgomez  personally i find these kinds of explanations confusing, since it's still based on determinism. 
it's better to use something that is not deterministic, which people actually associated with something random. 
e.g a dice has 6 potential positions, but it's position won't be determined until it is thrown. your 6-sided die will never however give you 7. an electrons position is more like a weighted million-sided die, where some positions are more likely than others.

