 @JerromyAugust  
Has nothing to do with dice

It's a matter of limited observation-based perspective. The observer is only allowed to be privy to some of the picture at a time. And the picture can change across observers of the same event.

 @PaulPaulPaulson  Very little is known about the process of a transition, mostly because it happens so fast we don't have a way to measure it.  (Sub-femtosecond, IIRC.)  Even in undergrad quantum mechanics we treated the transitions as instantaneous.

But electron orbitals do deform as atoms get closer - in my mental model, the distribution of the wave function is the electron (and it is the distribution of the mass and charge), and electrons repel eachother, which is a deformation of the wave functions.

(If I didn't have to work for a living I might go back to studying these things - and maybe creating interactive simulators where you can push atoms around and see the visualization change accordingly, as well as tools to see and understand the equations.)

