i think this is correct.

 @Luco129  To add to that. It seems to me that there is far too little teaching in understanding a models advantages and disadvantages, along with the skill to asses and judge the merits of a model. Teachers should use different kinds of models of the atom, depending on what they focusing on, but at the same time and this might be the most important part, they should teach their students why they are using a particular model in a particular case. A student should see multiple models to get the full understanding, going back to the globe/map example, it would be bad if you didn't use both or didn't taught why they differ.

I am actually in a position, where I as a physics teacher I have shown my pupils different kinds of models of an atom and asked them what their individual use are and which one they liked best. The whole point of the exercise was to teach them about this simplicity/accuracy duality in models and have them understand there is no objectively better, as it depends on the situation.


Thanks for both your comments by the way. By having engaged in this thread I have actually come to appreciate Henry's model more, not for what it is or what it looks like, but for making the effort to create a model that shows what others do not. Even while I advocate that each model have its merits, I am still biased towards the ones I know and like. By reiterating the nature of a model to you and myself, I took a second look at Henry's model and saw it differently than my initial view of it. I was a bit too much focused on its application, rather than trying to understand why it was created in the first place. Henry was tired of only looking at the equivalent of a map of an atom and decided to make a globe to show us an atom in a way that we have never seen before.

